import React from "react";
import Row from "../components/Row";
import "./Rows.css";

const fetchParams = {
  trending: "trending/all/week",
  netflixOriginals: "discover/tv"
};

const Rows = () => {
  return (
    <div>
      <Row ti fetchParam={fetchParams.trending} />
      <Row fetchParam={fetchParams.netflixOriginals} />
    </div>
  );
};

export default Rows;
